def ts2float(timestamp):
    year = float(timestamp[:4])
    month = int(timestamp[5:7]) - 1
    day = float(timestamp[8:]) - 1.
    isLeapYear = 1. if year % 4 == 0 else 0.
    DaysPerMonth = [31., 28.+isLeapYear, 31., 30., 31., 30., 31., 30., 31., 31., 30., 31.]
    return year + (sum(DaysPerMonth[:month]) + day) / (365. + isLeapYear)

